import React from 'react';
import Carousel from 'react-material-ui-carousel'
import { Paper, Button } from '@mui/material'
import { Typography, Container, Box } from '@mui/material';
import { carrouselData } from "../../utils/carrouselData"

export const Carrousel = () => {
    const items = [
        {
            name: "Random Img #1",
        },
        {
            name: "Random Img #2",
        }
    ]

    return (
        <Container
            sx={{
                width: "100vw",
                backgroundColor: "#0000006d",
                position: "absolute",
                zIndex: 999,
            }}>
            <Box sx={{
                height: "100%",
                width: "100%",
                backgroundColor: "#0000006d",
                position: "absolute",
                zIndex: 999,
            }}>
                <Typography>WELCOME</Typography>
                <Typography>LAS SALINAS</Typography>
                <Button>BOOK NOW</Button>
            </Box>

            <Box sx={{
                height: "80vh",
                overflow: "hidden",
                position: "relative",
                zIndex: 99,
            }}>
                <Carousel interval="2000">
                    {
                        carrouselData.map( (item, i) => <Item key={i} item={item} /> )
                    }
                </Carousel>
            </Box>
        </Container>
    )
}

const Item = ({item}) => {
    return (
        <Paper sx={{
        }}>
            <img 
                src={item.url} 
                alt={item.description}
                 />
        </Paper>
    )
}
